import styled from "styled-components";
import '../App.css';

const HeaderContainer = styled.div`
  display: flex;
  justify-content: center;
`

const PersonalArea = styled.button`
  width: 170px;
  height: 50px;
  background-color: blueviolet;
  border: none;
`

const Header = () => {
  return (
    <HeaderContainer>
      <PersonalArea>
        net
      </PersonalArea>
    </HeaderContainer>
  );
}

export default Header;
